var request = require('request');
var schedule = require('node-schedule')

var clockin = function(user,image_base64){
    request.post({url:'http://checkin.dnslab.cn:1059/checkin/Recognize',form:{
    // request.post({url:'http://localhost:3000',form:{
        msgid: '1',
        source: '3',
        compid: '1',
        clientid: '1',
        userid: user,
        resultcount: 1,
        xleft: 0,
        xright: 0,
        yleft: 0,
        yright: 0,
        format: 2,
        image:image_base64
    }},function(err,httpResponse,body){ /* ... */
        if(err)
        {
            console.log(err);

        }
        else{
            console.log('Upload successful!  Server responded with:', body);
        }
    });
}

function randomIntInc (low, high) {
    return Math.floor(Math.random() * (high - low + 1) + low);
}

// console.log(randomIntInc(1,5));


var rule = new schedule.RecurrenceRule();
rule.dayOfWeek = [new schedule.Range(1, 5)];
rule.hour = 18;
rule.minute = 32;
var randtime = 3000000*Math.random();
var j = schedule.scheduleJob(rule, function(){
    console.log(randtime);
    setTimeout(function(){
        clockin(5120,'');
        setTimeout(function(){
            clockin(5120,'');
        },10000);
        setTimeout(function(){
            clockin(5120,'');
        },10000);
      },randtime);
    randtime = 3600000*Math.random();
    setTimeout(function () {
        clockin(5040,'');
        setTimeout(function(){
        clockin(5040,'');
        },10000);
        setTimeout(function(){
         clockin(5040,'');
        },10000);
     },randtime);
});
 
